INSERT INTO `dle_category_face` (`category_id`, `name`, `name_pages`, `description`, `description_pages`, `module_placement`, `show_name`, `show_description`, `name_placement`, `description_placement`) VALUES
(1, 'Аниме смотреть онлайн', '', 'В 2030 году исследовательская экспедиция Арес 3 достигает Марса. Создав на его поверхности временную базу с искусственной средой обитания, команда астронавтов планирует в течение двух месяцев заниматься изучением красной планеты. Но по истечению восемнадцати дней на Марсе начинается очень сильная песчаная буря и группе исследователей приходится срочным образом эвакуироваться с изучаемого объекта, отказавшись от заранее намеченных планов, понимая, что в противном случае они могут навсегда остаться на безлюдной планете. Во время спешной эвакуации, повредив свои приборы, в начавшейся буре пропадает ученый-ботаник Марк Уотни. Командир экипажа Мелисса Льюис, посчитав его погибшим, принимает решение срочным образом покинуть Марс, чтобы спасти остальных членов команды.\nЧудом выживший во время марсианского шторма Уотни возвращается на временную базу и выясняет, что связаться с Землей не представляется возможным. Оставшись в полном одиночестве на безжизненной планете, понимая, что следующая экспедиция на Марс запланирована через четыре года, а запасов пищи ему хватит максимум на один, нашему герою предстоит решить непростую задачу: попытаться наладить контакт с Землей и, несмотря ни на что, выжить в сложившейся ситуации, используя все свои знания и навыки, чтобы, в один прекрасный момент, снова ступить на поверхность родной планеты.', '', 'all_pages', 'show', 'show', 'all_pages', 'first_page'),
(2, 'Биография онлайн', '', '<p>Фильмы биографии всегда привлекают внимание зрителей и в этом нет ничего удивительного, ведь каждый  понимает, что в основе каждого такого фильма лежит реальная история, которая происходила с реальными людьми. Несмотря на то, что режиссеры порой добавляют что-то от себя в эти фильмы они не становятся хуже, наоборот, они лучше доносят до нас те события, которые происходили с этими людьми и помогают прочувствовать ту атмосферу, которую переживали реальные герои. Смотреть такие киноленты всегда очень увлекательно, ведь на протяжении всего просмотра вас не оставляет мысль о том, что это не выдуманная история. Данные фильмы всегда тепло встречаются кинокритиками и собирают большое количество наград. В мире жило очень много интересных людей, о жизни которых мы порой узнаем лишь из книг, но возможность<strong> смотреть фильмы биографии в хорошем качестве позволяет более детально узнать об их личностях, либо событиях, которые с ними происходили.</strong></p><br><p>Если же вы все таки надумали смотреть фильмы биографии бесплатно, то вы попали именно туда, куда надо. Наш сайт предлагает вам широкий выбор отличных фильмов данного жанра, причем вам не надо регистрироваться, просто запускаете видео и смотрите. Ведь не всегда тот или иной фильм показывают в кинотеатре, да и возможность сходить в него тоже не всегда имеется, именно поэтому мы рекомендуем вам посмотреть их прямо с нашего сайта и вам не придется выходить из дома. Все фильмы исключительно в хорошем качестве и с отличным переводом, который вас не разочарует. Если же вы не нашли фильм биографию, который хотели посмотреть - вы всегда можете оставить заявку через стол заказов и мы обязательно добавим его в нашу коллекцию. Приятного вам просмотра!</p>', '<p>Фильмы биографии всегда привлекают внимание зрителей и в этом нет ничего удивительного, ведь каждый  понимает, что в основе каждого такого фильма лежит реальная история, которая происходила с реальными людьми. Несмотря на то, что режиссе